        })
    });

    function getCep(cep) {
        fetch('https://ws.apicep.com/cep/' + cep + '.json', { method: 'GET' })
            .then(response => response.json())
            .then(json => {
                if (json.address == undefined) {
                    alert('CEP inválido');
                    return;
                }

                $(""#Endereco"").val(json.address + ', ' + json.district + '. ' + json.city + ' - ' + json.state);
            });
    }

